431\u043e\u043b\u044c\u0448\u0435 \u0435\u0433\u043e \u0440\u043e\u0434\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%BE%D1%82%D0%BB%D0%B0%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u044f\">\u0428\u043e\u0442\u043b\u0430\u043d\u0434\u0438\u0438<\/a>) \u043d\u0430 \u043c\u0435\u0441\u0442\u0435 \u043d\u044b\u043d\u0435\u0448\u043d\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D0%B8%D1%82%D0%BE%D0%B1%D0%B0\" title=\"\u041c\u0430\u043d\u0438\u0442\u043e\u0431\u0430\">\u041c\u0430\u043d\u0438\u0442\u043e\u0431\u044b<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D0%BD%D0%B5%D1%81%D0%BE%D1%82%D0%B0\" title=\"\u041c\u0438\u043d\u043d\u0435\u0441\u043e\u0442\u0430\">\u041c\u0438\u043d\u043d\u0435\u0441\u043e\u0442\u044b<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80%D0%BD%D0%B0%D1%8F_%D0%94%D0%B0%D0%BA%D0%BE%D1%82%D0%B0\" title=\"\u0421\u0435\u0432\u0435\u0440\u043d\u0430\u044f \u0414\u0430\u043a\u043e\u0442\u0430\">\u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u0414\u0430\u043a\u043e\u0442\u044b<\/a>&#160;\u2014 \u0432\u0441\u0435\u0433\u043e \u0437\u0430 10 \u0448\u0438\u043b\u043b\u0438\u043d\u0433\u043e\u0432 \u0432 \u0433\u043e\u0434.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1815_%D0%B3%D0%BE%D0%B4\" title=\"1815 \u0433\u043e\u0434\">1815<\/a>&#160;\u2014 \u0432\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0435 \u0438\u043d\u0442\u0440\u0438\u0433 \u0431\u0430\u043d\u043a\u0438\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%82%D1%88%D0%B8%D0%BB%D1%8C%D0%B4,_%D0%9D%D0%B0%D1%82%D0%B0%D0%BD_%D0%9C%D0%B0%D0%B9%D0%B5%D1%80\" title=\"\u0420\u043e\u0442\u0448\u0438\u043b\u044c\u0434, \u041d\u0430\u0442\u0430\u043d \u041c\u0430\u0439\u0435\u0440\">\u041d\u0430\u0442\u0430\u043d\u0430 \u0420\u043e\u0442\u0448\u0438\u043b\u044c\u0434\u0430<\/a>, \u043b\u043e\u043d\u0434\u043e\u043d\u0441\u043a\u0430\u044f \u0433\u0430\u0437\u0435\u0442\u0430 \u00ab\u041c\u043e\u0440\u043d\u0438\u043d\u0433 \u041a\u0440\u043e\u043d\u0438\u043a\u043b\u00bb \u0441\u043e\u043e\u0431\u0449\u0438\u043b\u0430 \u043e \u043f\u043e\u0431\u0435\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_I_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d I \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d\u0430<\/a> \u043f\u0440\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%92%D0%B0%D1%82%D0%B5%D1%80%D0%BB%D0%BE%D0%BE\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0412\u0430\u0442\u0435\u0440\u043b\u043e\u043e\">\u0412\u0430\u0442\u0435\u0440\u043b\u043e\u043e<\/a> \u043d\u0430 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0434\u043d\u0435\u0439 \u0440\u0430\u043d\u044c\u0448\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u044f (\u0420\u043e\u0442\u0448\u0438\u043b\u044c\u0434, \u0441\u044b\u0433\u0440\u0430\u0432 \u043d\u0430 \u043f\u0430\u043d\u0438\u043a\u0435, \u0441\u043a\u0443\u043f\u0438\u043b \u043c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u043e \u0430\u043a\u0446\u0438\u0439).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1824_%D0%B3%D0%BE%D0%B4\" title=\"1824 \u0433\u043e\u0434\">1824<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0443\u0432\u0438\u0434\u0435\u043b\u0430 \u0441\u0432\u0435\u0442 \u043f\u0435\u0440\u0432\u0430\u044f \u0438 \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u043d\u0430\u0443\u0447\u043d\u0430\u044f \u0440\u0430\u0431\u043e\u0442\u0430 28-\u043b\u0435\u0442\u043d\u0435\u0433\u043e \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0435\u043d\u043d\u043e\u0433\u043e \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u0430 \u0438 \u0444\u0438\u0437\u0438\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%BD%D0%BE,_%D0%A1%D0%B0%D0%B4%D0%B8\" title=\"\u041a\u0430\u0440\u043d\u043e, \u0421\u0430\u0434\u0438\">\u041d\u0438\u043a\u043e\u043b\u0430 \u041b\u0435\u043e\u043d\u0430\u0440\u0434\u0430 \u0421\u0430\u0434\u0438 \u041a\u0430\u0440\u043d\u043e<\/a> \u00ab\u0420\u0430\u0437\u043c\u044b\u0448\u043b\u0435\u043d\u0438\u044f \u043e \u0434\u0432\u0438\u0436\u0443\u0449\u0435\u0439 \u0441\u0438\u043b\u0435 \u043e\u0433\u043d\u044f \u0438 \u043e \u043c\u0430\u0448\u0438\u043d\u0430\u0445, \u0441\u043f\u043e\u0441\u043e\u0431\u043d\u044b\u0445 \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u0442\u044c \u044d\u0442\u0443 \u0441\u0438\u043b\u0443\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1844_%D0%B3%D0%BE%D0%B4\" title=\"1844 \u0433\u043e\u0434\">1844<\/a>&#160;\u2014 \u0434\u0435\u0440\u0435\u0432\u043d\u0438 \u0412\u043e\u0445\u043e\u043d\u0441\u043a\u043e\u0439 \u0432\u043e\u043b\u043e\u0441\u0442\u0438 \u043e\u0431\u044a\u0435\u0434\u0438\u043d\u0438\u043b\u0438\u0441\u044c \u0432 \u043e\u0434\u0438\u043d \u0433\u043e\u0440\u043e\u0434&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B2%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%9F%D0%BE%D1%81%D0%B0%D0%B4\" title=\"\u041f\u0430\u0432\u043b\u043e\u0432\u0441\u043a\u0438\u0439 \u041f\u043e\u0441\u0430\u0434\">\u041f\u0430\u0432\u043b\u043e\u0432\u0441\u043a\u0438\u0439 \u041f\u043e\u0441\u0430\u0434<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1849_%D0%B3%D0%BE%D0%B4\" title=\"1849 \u0433\u043e\u0434\">1849<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%81%D0%BB%D0%B5%D1%82%D1%82,_%D0%9B%D1%8C%D1%8E%D0%B8%D1%81\" title=\"\u0425\u0430\u0441\u043b\u0435\u0442\u0442, \u041b\u044c\u044e\u0438