;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D0%B8%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_1872_%D0%B3%D0%BE%D0%B4%D0%B0\" title=\"\u041f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 1872 \u0433\u043e\u0434\u0430\">\u041f\u0435\u0440\u0432\u0430\u044f \u0432\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u043f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430<\/a>, \u043f\u0440\u0438\u0443\u0440\u043e\u0447\u0435\u043d\u043d\u0430\u044f \u043a \u043f\u0440\u0430\u0437\u0434\u043d\u043e\u0432\u0430\u043d\u0438\u044e 200-\u043b\u0435\u0442\u0438\u044f \u0441\u043e \u0434\u043d\u044f \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%91%D1%82%D1%80_I\" title=\"\u041f\u0451\u0442\u0440 I\">\u041f\u0435\u0442\u0440\u0430 I<\/a>. \u041c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u044b \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0438 \u043b\u0435\u0433\u043b\u0438 \u0432 \u043e\u0441\u043d\u043e\u0432\u0443 \u0441\u043e\u0437\u0434\u0430\u043d\u043d\u043e\u0433\u043e \u0432 \u0442\u043e\u043c \u0436\u0435 \u0433\u043e\u0434\u0443 \u041f\u043e\u043b\u0438\u0442\u0435\u0445\u043d\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u043c\u0443\u0437\u0435\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1897_%D0%B3%D0%BE%D0%B4\" title=\"1897 \u0433\u043e\u0434\">1897<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%AD%D0%BB%D0%B7%D0%B5%D0%BD%D0%B5%D1%80,_%D0%9A%D0%B0%D1%80%D0%BB&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u042d\u043b\u0437\u0435\u043d\u0435\u0440, \u041a\u0430\u0440\u043b (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u041a\u0430\u0440\u043b \u042d\u043b\u0437\u0435\u043d\u0435\u0440<\/a> \u0437\u0430\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043b \u0437\u043d\u0430\u043c\u0435\u043d\u0438\u0442\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D1%80%D0%BC%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BD%D0%BE%D0%B6\" title=\"\u0428\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u043a\u0438\u0439 \u0430\u0440\u043c\u0435\u0439\u0441\u043a\u0438\u0439 \u043d\u043e\u0436\">\u0448\u0432\u0435\u0439\u0446\u0430\u0440\u0441\u043a\u0438\u0439 \u0430\u0440\u043c\u0435\u0439\u0441\u043a\u0438\u0439 \u043d\u043e\u0436<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1898_%D0%B3%D0%BE%D0%B4\" title=\"1898 \u0433\u043e\u0434\">1898<\/a>&#160;\u2014 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0435 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%B8%D0%BD%D1%8B\" title=\"\u0424\u0438\u043b\u0438\u043f\u043f\u0438\u043d\u044b\">\u0424\u0438\u043b\u0438\u043f\u043f\u0438\u043d<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1901_%D0%B3%D0%BE%D0%B4\" title=\"1901 \u0433\u043e\u0434\">1901<\/a>&#160;\u2014 \u043e\u0434\u043e\u0431\u0440\u0435\u043d\u0430 \u043d\u043e\u0432\u0430\u044f \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f \u0434\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%B0\" title=\"\u041a\u0443\u0431\u0430\">\u041a\u0443\u0431\u044b<\/a>, \u0432 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u043e\u0441\u043e\u0431\u044b\u0435 \u043f\u0440\u0430\u0432\u0430 \u0432 \u044d\u0442\u043e\u0439 \u0441\u0442\u0440\u0430\u043d\u0435. \u0424\u0430\u043a\u0442\u0438\u0447\u0435\u0441\u043a\u0438 \u044d\u0442\u043e \u043e\u0437\u043d\u0430\u0447\u0430\u043b\u043e \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435 \u043d\u0430\u0434 \u041a\u0443\u0431\u043e\u0439 \u043f\u0440\u043e\u0442\u0435\u043a\u0442\u043e\u0440\u0430\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>. \u0414\u0435\u0439\u0441\u0442\u0432\u0438\u0435 \u044d\u0442\u043e\u0439 \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u0438 \u0431\u044b\u043b\u043e \u043f\u0440\u0438\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u043e \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925 \u0433\u043e\u0434\u0443<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a>&#160;\u2014 \u043f\u043e\u0434\u043d\u044f\u043b\u0441\u044f \u0432 \u0432\u043e\u0437\u0434\u0443\u0445 \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D0%BF%D0%BB%D0%B0%D0%BD\" class=\"mw-redirect\" title=\"\u0410\u044d\u0440\u043e\u043f\u043b\u0430\u043d\">\u0430\u044d\u0440\u043e\u043f\u043b\u0430\u043d<\/a> \u0441 \u043f\u0438\u043b\u043e\u0442\u043e\u043c \u0438 \u0434\u0432\u0443\u043c\u044f \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0430\u043c\u0438, \u00ab\u0411\u043b\u0435\u0440\u0438\u043e XII\u00bb. \u041d\u0430 \u043d\u0451\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BB%D0%B5%D1%80%D0%B8%D0%BE,_%D0%9B%D1%83%D0%B8\" title=\"\u0411\u043b\u0435\u0440\u0438\u043e, \u041b\u0443\u0438\">\u041b\u0443\u0438 \u0411\u043b\u0435\u0440\u0438\u043e<\/a> \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u043f\u043e\u043b\u0451\u0442 \u0432\u043c\u0435\u0441\u0442\u0435 \u0441 \u0410\u043b\u044c\u0431\u0435\u0440\u0442\u043e \u0421\u0430\u043d\u0442\u043e\u0441-\u0414\u044e\u043c\u043e\u043d\u043e\u043c \u0438 \u0410\u043d\u0434\u0440\u0435 \u0424\u0443\u0440\u043d\u044c\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u0438\u0434\u0435\u043e\u043b\u043e\u0433 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B0%D1%80%D1%85%D0%B8%D0%B7%D0%BC\" title=\"\u0410\u043d\u0430\u0440\u0445\u0438\u0437\u043c\">\u0430\u043d\u0430\u0440\u0445\u0438\u0437\u043c\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%BE%D0%BF%D0%BE%D1%82%D0%BA%D0%B8%D0%BD,_%D0%9F%D1%91%D1%82%D1%80_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0440\u043e\u043f\u043e\u0442\u043a\u0438\u043d, \u041f\u0451\u0442\u0440 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447\">\u041f\u0451\u0442\u0440 \u041a\u0440\u043e\u043f\u043e\u0442\u043a\u0438\u043d<\/a> \u0441 \u0442\u0440\u0438\u0443\u043c\u0444\u043e\u043c \u0432\u0435\u0440\u043d\u0443\u043b\u0441\u044f \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u044e<\/a> \u0438\u0437 \u044d\u043c\u0438\u0433\u0440\u0430\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%BD%D0%B0%D0%BC%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB\" title=\"\u041f\u0430\u043d\u0430\u043c\u0441\u043a\u0438\u0439 \u043a\u0430\u043d\u0430\u043b\">\u041f\u0430\u043d\u0430\u043c\u0441\u043a\u043e\u0433\u043e \u043a\u0430\u043d\u0430\u043b\u0430<\/a> (\u043f\u0435\u0440\u0432\u043e\u0435 \u0441\u0443\u0434\u043d\u043e \u043f\u0440\u043e\u0448\u043b\u043e \u0447\u0435\u0440\u0435\u0437 \u043a\u0430\u043d\u0430\u043b \u0432 \u0430\u0432\u0433\u0443\u0441\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914 \u0433\u043e\u0434\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0435<\/a> \u0432 \u0431\u044b\u0432\u0448\u0435\u043c \u0437\u0430\u043b\u0435 \u0414\u0432\u043e\u0440\u044f\u043d\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u044f \u043f\u0440\u043e\u0448\u043b\u043e \u0442\u043e\u0440\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0435 \u043e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%84%D0%B8%D0%BB%D0%B0%D1%80%D0%BC%D0%BE%D0%BD%D0%B8%D1%8F_%D0%B8%D0%BC._%D0%94._%D0%94._%D0%A8%D0%BE%D1%81%D1%82%D0%B0%D0%BA%D0%BE%D0%B2%D0%B8%D1%87%D0%B0\" class=\"mw-redirect\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0430\u044f \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0444\u0438\u043b\u0430\u0440\u043c\u043e\u043d\u0438\u044f \u0438\u043c. \u0414. \u0414. \u0428\u043e\u0441\u0442\u0430\u043a\u043e\u0432\u0438\u0447\u0430\">\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0444\u0438\u043b\u0430\u0440\u043c\u043e\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e \u0432\u0435\u0449\u0430\u043d\u0438\u0435 \u043b\u0438\u0442\u043e\u0432\u0441\u043a\u043e\u0435 \u0440\u0430\u0434\u0438\u043e (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%83%D0%BD%D0%B0%D1%81\" title=\"\u041a\u0430\u0443\u043d\u0430\u0441\">\u041a\u0430\u0443\u043d\u0430\u0441<\/a>); \u043f\u0435\u0440\u0432\u044b\u0439 \u0434\u0438\u043a\u0442\u043e\u0440&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B1%D0%B8%D1%86%D0%BA%D0%B0%D1%81,_%D0%9F%D1%8F%D1%82%D1%80%D0%B0%D1%81\" title=\"\u0411\u0430\u0431\u0438\u0446\u043a\u0430\u0441, \u041f\u044f\u0442\u0440\u0430\u0441\">\u041f\u044f\u0301\u0442\u0440\u0430\u0441 \u0411\u0430\u0431\u0438\u0301\u0446\u043a\u0430\u0441<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1926_%D0%B3%D0%BE%D0%B4\" title=\"1926 \u0433\u043e\u0434\">1926<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D0%B8%D1%8F\" title=\"\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u044f\">\u0411\u0440\u0430\u0437\u0438\u043b\u0438\u044f<\/a> \u043f\u043e\u043a\u0438\u043d\u0443\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B3%D0%B0_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041b\u0438\u0433\u0430 \u041d\u0430\u0446\u0438\u0439\">\u041b\u0438\u0433\u0443 \u041d\u0430\u0446\u0438\u0439<\/a> \u0432 \u0437\u043d\u0430\u043a \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430 \u043f\u0440\u043e\u0442\u0438\u0432 \u043f\u0440\u0438\u043d\u044f\u0442\u0438\u044f \u0442\u0443\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f\">\u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1935_%D0%B3%D0%BE%D0%B4\" title=\"1935 \u0433\u043e\u0434\">1935<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D1%81%D1%81%D0%BE%D0%BB%D0%B8%D0%BD%D0%B8,_%D0%91%D0%B5%D0%BD%D0%B8%D1%82%D0%BE\" title=\"\u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438, \u0411\u0435\u043d\u0438\u0442\u043e\">\u041c\u0443\u0441\u0441\u043e\u043b\u0438\u043d\u0438<\/a> \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u043b \u043f\u0440\u043e\u0434\u0430\u0436\u0443 \u0433\u0430\u0437\u0435\u0442\u044b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA_%D1%82%D0%B0%D0%B9%D0%BC%D1%81\" class=\"mw-redirect\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a \u0442\u0430\u0439\u043c\u0441\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a \u0442\u0430\u0439\u043c\u0441<\/a>\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u0438<\/a> \u00ab\u0437\u0430 \u043d\u0435\u043e\u0431\u044a\u0435\u043a\u0442\u0438\u0432\u043d\u043e\u0435 \u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 \u0434\u0435\u044f\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0444\u0430\u0448\u0438\u0441\u0442\u043e\u0432\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1936_%D0%B3%D0%BE%D0%B4\" title=\"1936 \u0433\u043e\u0434\">1936<\/a><ul><li>\u041f\u043e\u044f\u0432\u0438\u043b\u0430\u0441\u044c \u043f\u0435\u0440\u0432\u0430\u044f \u043a\u043e\u0440\u043e\u0442\u043a\u043e\u0432\u043e\u043b\u043d\u043e\u0432\u0430\u044f \u0430\u043c\u0435